 Her fighting style used fluid motions that allowed her to elude and confuse her enemies. She would then strike them at in their weakest point. It was said that Lin Vo\'s fluid motions were so deceptive that she was only ever hit once.',10,0,0,0,0,1,1),(1828,100245,'Generic',0,0,'Trial of Qin Lo',0,0,0,0,'Qin Lo the Persistent never quit a fight once entered, no matter the odds. He once was involved in a brawl in tea house, where his three opponents suddenly became fifty. He slew them all showing a persistence of will yet unmatched.',10,0,0,0,0,1,1),(1829,100246,'Zone',558,3016751812,'To the Mediation Chamber',25.4745,35.4027,-178.762,0,'',20,0,0,0,0,1,1),(1830,100247,'Generic',0,0,'Trial of Sun Kai',0,0,0,0,'Golden Sun Kai was a master of harnessing his bloodlust. Legend tells that when the mayor of Sun Kai\'s village was kidnapped by murderous bandits, Sun Kai infiltrated their stronghold to save the mayor. Instead of butchering all of the bandits, like he felt would be justice, he kept to the task. He saved the mayor quicker than a snake can strike, while only killing five enemies.',10,0,0,0,0,1,1),(1831,100248,'Generic',0,0,'Trial of Li Zhong',0,0,0,0,'Li Zhong the Decimator was known for his killing speed. He was once tested against two hundred foes and slew them all in less time than it takes for a child to cry after falling. All honor his accomplishment, even his fallen enemies.',10,0,0,0,0,1,1),(1832,100249,'Generic',0,0,'an old birdcage',0,0,0,0,'',20,0,0,0,0,0,1),(1833,100250,'Generic',0,0,'an old birdcage',0,0,0,0,'',20,0,0,0,0,0,1),(1834,100251,'Zone',9,966876915,'To the Mystic Lake',-281.645,8.3067,-182.591,0,'',20,274.708,-48.0846,327.071,180,1,1),(1835,100252,'Zone',4,653790280,'a loose rock',165.016,-3.00626,13.3178,0,'',20,-11.75,0,-1.42,180,0,0),(1836,100253,'Generic',0,0,'a letter',0,0,0,0,'This letter is addressed to the Far Seas Trading Company.  The top page is visible.',10,0,0,0,0,1,1),(1837,100254,'Generic',0,0,'Voyage by Sea',0,0,0,0,'',12,0